import * as React from 'react';
import { StyleSheet } from 'react-native';
import { FAB as ParentFAB } from 'react-native-paper';

export const FAB = () => (
  <ParentFAB
    style={styles.fab}
    small
    icon="plus"
    onPress={() => console.log('Pressed')}
  />
);

const styles = StyleSheet.create({
  fab: {
    position: 'absolute',
    margin: 16,
    right: 0,
    bottom: 0,
  },
})
